        "#1.b Landau\n",
        "# Parámetros y condiciones iniciales indicadas en el enunciado para el sistema\n",
        "c = 1.0\n",
        "q = 7.5284\n",
        "B0 = 0.438\n",
        "E0 = 0.7423\n",
        "m = 3.8428\n",
        "k = 1.0014\n",
        "\n",
        "# Sistema de ecuaciones\n",
        "def landau(t, u):\n",
        "    x, vx, y, vy = u\n",
        "    dxdt = vx\n",
        "    dydt = vy\n",
        "    dvxdt = (q/m) * (E0 * (np.sin(k*x) + k*x*np.cos(k*x)) - B0 * vy)\n",
        "    dvydt = (q*B0/m) * vx\n",
        "    return [dxdt, dvxdt, dydt, dvydt]\n",
        "\n",
        "# Condiciones iniciales\n",
        "u0 = [0.1, 0.0, 0.0, 0.1]  # x, vx, y, vy\n",
        "\n",
        "# Intervalo de integración\n",
        "t_span = (0, 30)\n",
        "t_eval = np.linspace(0, 30, 2000)\n",
        "\n",
        "# Resolver EDO\n",
        "sol = solve_ivp(landau, t_span, u0, t_eval=t_eval, method=\"DOP853\")\n",
        "\n",
        "x, vx, y, vy = sol.y\n",
        "\n",
        "# Ecuaciones de Conservación: Momento conjugado y Energía\n",
        "Pi_y = m*vy - q*B0*x/c\n",
        "E_tot = 0.5*m*(vx**2 + vy**2) - q*E0*x*np.sin(k*x)\n",
        "\n",
        "# Ploteo\n",
        "plt.figure(figsize=(12,8))\n",
        "\n",
        "# Trayectoria (x,y)\n",
        "plt.subplot(2,2,1)\n",
        "plt.plot(x, y, lw=1.5)\n",
        "plt.xlabel(\"x\")\n",
        "plt.ylabel(\"y\")\n",
        "plt.title(\"Trayectoria en el plano (x,y)\")\n",
        "plt.grid(True)\n",
        "\n",
        "plt.tight_layout()\n",
        "plt.savefig(\"1.bTrayectoria.pdf\")\n",
        "\n",
        "# Velocidades\n",
        "plt.subplot(2,2,2)\n",
        "plt.plot(sol.t, vx, label=\"vx\")\n",
        "plt.plot(sol.t, vy, label=\"vy\")\n",
        "plt.xlabel(\"t\")\n",
        "plt.ylabel(\"Velocidad\")\n",
        "plt.legend()\n",
        "plt.title(\"Velocidades vs tiempo\")\n",
        "plt.grid(True)\n",
        "plt.tight_layout()\n",
        "plt.savefig(\"1.bVelocidad.pdf\")\n",
        "\n",
        "# Momento conjugado\n",
        "plt.subplot(2,2,3)\n",
        "plt.plot(sol.t, Pi_y)\n",
        "plt.xlabel(\"t\")\n",
        "plt.ylabel(r\"$\\Pi_y$\")\n",
        "plt.title(\"Momento conjugado\")\n",
        "plt.grid(True)\n",
        "plt.tight_layout()\n",
        "plt.savefig(\"1.bMomentoConjugado.pdf\")\n",
        "\n",
        "# Energía total\n",
        "plt.subplot(2,2,4)\n",
        "plt.plot(sol.t, E_tot)\n",
        "plt.xlabel(\"t\")\n",
        "plt.ylabel(\"Energía total\")\n",
        "plt.title(\"Conservación de energía\")\n",
        "plt.grid(True)\n",
        "\n",
        "plt.tight_layout()\n",
        "plt.savefig(\"1.bEnergiaTotal.pdf\")\n"
