        "#1.c  Sistema Binario\n",
        "#1c\n",
        "\n",
        "# Parámetros y condiciones iniciales indicadas en el enunciado para el sistema\n",
        "G = 1.0\n",
        "m = 1.7\n",
        "\n",
        "# Sistema de ecuaciones diferenciales\n",
        "def sistema(t, y):\n",
        "    x1, y1, vx1, vy1, x2, y2, vx2, vy2 = y\n",
        "\n",
        "    # Vector posición y distancia entre las estrellas\n",
        "    r12 = np.array([x1 - x2, y1 - y2])\n",
        "    dist = np.linalg.norm(r12)\n",
        "\n",
        "    # Aceleraciones por gravitación\n",
        "    a1 = -G * m * r12 / dist**3\n",
        "    a2 =  G * m * r12 / dist**3\n",
        "\n",
        "    return [vx1, vy1, a1[0], a1[1],\n",
        "            vx2, vy2, a2[0], a2[1]]\n",
        "\n",
        "# Condiciones iniciales\n",
        "y0 = [0, 0, 0, 0.5,   # x1, y1, vx1, vy1\n",
        "      1, 1, 0, -0.5]  # x2, y2, vx2, vy2\n",
        "\n",
        "# Intervalo de integración\n",
        "t_span = (0, 10)\n",
        "t_eval = np.linspace(t_span[0], t_span[1], 2000)\n",
        "\n",
        "# Resolver con RK45\n",
        "sol = solve_ivp(sistema, t_span, y0, method=\"RK45\", t_eval=t_eval, rtol=1e-9, atol=1e-12)\n",
        "\n",
        "# Extraer soluciones\n",
        "x1, y1 = sol.y[0], sol.y[1]\n",
        "x2, y2 = sol.y[4], sol.y[5]\n",
        "\n",
        "# Graficar trayectorias\n",
        "plt.figure(figsize=(7,7))\n",
        "plt.plot(x1, y1, label=\"Estrella 1 (m=1.7)\", color=\"blue\")\n",
        "plt.plot(x2, y2, label=\"Estrella 2 (m=1.7)\", color=\"red\")\n",
        "plt.scatter([x1[0], x2[0]], [y1[0], y2[0]], c=[\"blue\",\"red\"], marker=\"o\", label=\"Posición inicial\")\n",
        "plt.xlabel(\"x\")\n",
        "plt.ylabel(\"y\")\n",
        "plt.title(\"Órbita de un sistema binario con RK45\")\n",
        "plt.legend()\n",
        "plt.axis(\"equal\")\n",
        "plt.grid()\n",
        "\n",
        "plt.tight_layout()\n",
        "plt.savefig(\"1.c.pdf\")\n"
