        "import numpy as np\n",
        "from scipy.integrate import solve_ivp\n",
        "import matplotlib.pyplot as plt\n",
        "import pandas as pd\n",
        "\n",
        "def lane_emden_ivp(x, S, n):\n",
        "    theta, y = S\n",
        "    dtheta_dx = y\n",
        "    dy_dx = -theta**n - (2/x)*y\n",
        "    return [dtheta_dx, dy_dx]\n",
        "\n",
        "def evento_primer_cero(x, S, n):\n",
        "    return S[0]\n",
        "evento_primer_cero.terminal = True\n",
        "evento_primer_cero.direction = -1\n",
        "\n",
        "n_values = [0.0, 1.0, 1.5, 2.0, 3.0, 4.0, 5.0]\n",
        "resultados = []\n",
        "\n",
        "fig, ax = plt.subplots(figsize=(10, 6))\n",
        "\n",
        "for i, n in enumerate(n_values):\n",
        "    x0 = 1e-6\n",
        "    theta0 = 1 - (x0**2)/6\n",
        "    dtheta0 = -x0/3\n",
        "    S0 = [theta0, dtheta0]\n",
        "\n",
        "    color = plt.cm.tab10(i / len(n_values))\n",
        "\n",
        "    if n != 5.0:\n",
        "        sol_ext = solve_ivp(\n",
        "            lane_emden_ivp,\n",
        "            [x0, 35],\n",
        "            S0,\n",
        "            args=(n,),\n",
        "            dense_output=True,\n",
        "            rtol=1e-12,\n",
        "            atol=1e-12,\n",
        "            max_step=0.01\n",
        "        )\n",
        "\n",
        "        sol_phys = solve_ivp(\n",
        "            lane_emden_ivp,\n",
        "            [x0, 35],\n",
        "            S0,\n",
        "            args=(n,),\n",
        "            events=lambda x, S, n=n: evento_primer_cero(x, S, n),\n",
        "            dense_output=True,\n",
        "            rtol=1e-12,\n",
        "            atol=1e-12,\n",
        "            max_step=0.01\n",
        "        )\n",
        "\n",
        "        if sol_phys.t_events[0].size > 0:\n",
        "            xs = sol_phys.t_events[0][0]\n",
        "            theta_xs, dtheta_xs = sol_phys.sol(xs)\n",
        "            M = -xs**2 * dtheta_xs\n",
        "            rho_ratio = -(1/3) * xs / dtheta_xs\n",
        "        else:\n",
        "            xs, M, rho_ratio = np.nan, np.nan, np.nan\n",
        "\n",
        "        resultados.append([n, xs, M, rho_ratio])\n",
        "\n",
        "\n",
        "        x_phys = np.linspace(x0, xs, 300)\n",
        "        y_phys = sol_phys.sol(x_phys)\n",
        "        ax.plot(x_phys, y_phys[0], color=color, label=f'n = {n}')\n",
        "\n",
        "        x_ext = np.linspace(x0, 35, 1000)\n",
        "        y_ext = sol_ext.sol(x_ext)\n",
        "        ax.plot(x_ext, y_ext[0], linestyle='-', color=color, alpha=0.5, label=f'n = {n}')\n",
        "\n",
        "    else:\n",
        "        # n=5\n",
        "        def theta_n5(x):\n",
        "            return 1.0 / np.sqrt(1 + x**2 / 3)\n",
        "\n",
        "        x_plot = np.linspace(0, 35, 1000)\n",
        "        theta_plot = theta_n5(x_plot)\n",
        "        ax.plot(x_plot, theta_plot, color=color, label=\"n = 5 (analítico)\")\n",
        "        xs = np.inf\n",
        "        M = np.pi * np.sqrt(3)\n",
        "        rho_ratio = np.inf\n",
        "        resultados.append([n, xs, M, rho_ratio])\n",
        "\n",
        "df = pd.DataFrame(resultados, columns=[\"Índice n\", \"Radio\", \"Masa\", \"ρ_c / ρ̄\"])\n",
        "df.to_csv(\"7.csv\", index=False)\n",
        "\n",
        "ax.set_xlabel('Radio adimensional $x$')\n",
        "ax.set_ylabel('Densidad relativa $\\\\theta(x)$')\n",
        "ax.set_title('Perfil de densidad estelar (Lane-Emden)')\n",
